"""
LeetCode :: July 2021 Challenge :: Three Equal Parts
jramaswami
"""


from collections import defaultdict


class Solution():
    def threeEqualParts(self, bits):
        # Total number of bits
        one_bits = sum(bits)

        # If there are not bits set than any partition will do.
        if one_bits == 0:
            return [0, len(bits)-1]

        # In order to partition into three equal numbers, the one bits
        # must be evenly distributed among the three partitions.  So the
        # number of bits must be evenly divisible by three for this to
        # be possible.
        if one_bits % 3:
            return [-1, -1]

        # So each partition gets one-third of the bits.
        part_bits = one_bits // 3

        # We will work backwards.  Let's find the MSB for the right-most
        # partition.  We will also get the LSB for the right-most parition,
        # because that cannot be altered.
        right_bits = 0
        right_msb = len(bits)
        right_lsb = 0
        for i in range(len(bits) - 1, -1, -1):
            right_bits += bits[i]
            if bits[i]:
                right_msb = min(i, right_msb)
                right_lsb = max(i, right_lsb)
            if right_bits == part_bits:
                break

        # Do the same for middle.
        middle_bits = 0
        middle_msb = len(bits)
        middle_lsb = 0
        for i in range(right_msb - 1, -1, -1):
            middle_bits += bits[i]
            if bits[i]:
                middle_msb = min(i, middle_msb)
                middle_lsb = max(i, middle_lsb)
            if middle_bits == part_bits:
                break

        # Do the same for left.
        left_bits = 0
        left_msb = len(bits)
        left_lsb = 0
        for i in range(middle_msb - 1, -1, -1):
            left_bits += bits[i]
            if bits[i]:
                left_msb = min(i, left_msb)
                left_lsb = max(i, left_lsb)
            if left_bits == part_bits:
                break

        # As we said above, we cannot change the number of trailing zeros
        # for the right most partition.  That means the left and right must
        # have the same number of trailing zeros after their lsb.
        trailing_zeros = len(bits) - right_lsb - 1

        i = left_lsb + trailing_zeros + 1
        j = middle_lsb + trailing_zeros + 1

        if i > middle_msb:
            return [-1, -1]

        if j > right_msb:
            return [-1, -1]

        # We can discard leading zeros.
        left = bits[left_msb:i]
        middle = bits[middle_msb:j]
        right = bits[right_msb:]

        if left == middle and middle == right:
            return [i-1, j]

        return [-1, -1]



def test_1():
    arr = [1,0,1,0,1]
    left, right = Solution().threeEqualParts(arr)
    assert [left, right] == [0, 3]


def test_2():
    arr = [1,1,0,1,1]
    left, right = Solution().threeEqualParts(arr)
    assert [left, right] == [-1, -1]


def test_3():
    arr = [1,1,0,0,1]
    left, right = Solution().threeEqualParts(arr)
    assert [left, right] == [0, 2]


def test_4():
    """WA"""
    arr = [0,0,0,0,0]
    left, right = Solution().threeEqualParts(arr)
    assert [left, right] == [0, 4]


